<!DOCTYPE HTML><html lang="en-US"><head>	<meta charset="UTF-8">	<title>Not examples</title></head><body>	<script type="text/javascript">		$("table tr:nth-child(even) > td:not(td.missme)").addClass("striped"); 				$('input[type=checkbox]:not(:checked)').css('border','solid');				$("td:empty:not(.missme)").text("Was empty!").css('background', 'rgb(255,220,200)');				$('a:not(.shooter)')				//select all fieldset that does not contain a legend		$('fieldset').not(':has(legend)') 	</script></body></html>
